function updateEventList() {
  var ss = SpreadsheetApp.getActiveSpreadsheet();
  var formResultsSheet = ss.getSheetByName('FormResults');
  var eventListSheet = ss.getSheetByName('EventList');

  var formResultsData = formResultsSheet.getRange(2, 1, formResultsSheet.getLastRow() - 1, 3).getValues();
  var eventListHeaders = eventListSheet.getRange(1, 1, 1, 16).getValues()[0];

  for (var i = 0; i < formResultsData.length; i++) {
    var name = formResultsData[i][1];
    var events = formResultsData[i][2].split(',');

    for (var j = 0; j < events.length; j++) {
      var event = events[j].trim();
      var columnIndex = eventListHeaders.indexOf(event);

      if (columnIndex !== -1) {
        eventListSheet.getRange(i + 2, columnIndex + 1).setValue(name);
      }
    }
  }
}
```

